import React from 'react'
import aboutImg from ".//Images/about-me.jpg"
function AboutMe() {
  return (
    <section id='AboutMe' className='about-section'>
      <div><img src={aboutImg} alt="Dipika Jain" height="450px"/></div>
      <div ></div>
      
    </section>
  )
}

export default AboutMe
